import botao from './nav.module.css';


export default function Menuh(){
    
    return(
        <div >
            <svg height="50" width="50" id="bot" className={botao.bot_h}>
                <path d="M 5 5 l 40 0"  stroke="white" stroke-width="4" fill="none" />
                <path d="M 20 20 l 25 0" stroke="white" stroke-width="4" fill="none" />
                <path d="M 35 45 l 10 0" stroke="white" stroke-width="4" fill="none" />
            </svg>
        </div>
    )
}
